const items = $input.all();

return items.map((item) => {
  // Get text safely
  let text = (item.json.output || "")
    .replace(/^```json\s*/i, "")   // remove ```json
    .replace(/```$/i, "")          // remove ending ```
    .trim();

  let parsed = {};
  try {
    parsed = JSON.parse(text);
  } catch (e) {
    parsed = {};
  }

  // Extract fields safely
  const output = parsed.output || "No output provided.";
  let nextStep = (parsed["Next Step"] || "").trim();
  const specialty = parsed["Specialty"] || "General";

  // Normalize nextStep value
  switch (true) {
    case /emergency|critical|immediate/i.test(nextStep):
      nextStep = "Emergency";
      break;
    case /self.?care|home remedy|mild/i.test(nextStep):
      nextStep = "Self-Care";
      break;
    case /consult|doctor|appointment|visit/i.test(nextStep):
      nextStep = "Consult Doctor";
      break;
    default:
      nextStep = "Consult Doctor";
  }

  // ‚úÖ Return cleaned and structured data
  return {
    json: {
      output,
      nextStep,
      Specialty: specialty,
    },
  };
});

