const nextStep = switchData.nextStep || "";
const specialty = switchData.Specialty || "";

// --- Fetch Doctor data from Google Sheet ---
const doctorRows = $items("Get row(s) in sheet");

// --- Find doctor/hospital details by Specialty ---
const match = doctorRows.find(row => {
  const data = row.json;
  return data.Specialty?.toLowerCase().trim() === specialty.toLowerCase().trim();
});

const hospital = match ? match.json["Hospital / Appointment Name"] : "City Health Clinic";
const phone = match ? match.json["Phone Number"] : "9876543210";

// --- Build final short message ---
let finalMessage = "";

if (nextStep.toLowerCase().includes("consult")) {
  finalMessage = `Based on your symptoms, you should consult a ${specialty} Physician. Please take an appointment for the consultation at ${hospital}. üìû ${phone}`;
}

// --- Return all details ---
return [
  {
    json: {
      output :output,
      NextStep: nextStep,
      Specialty: specialty,
      Hospital: hospital,
      Phone: phone,
      FinalMessage: finalMessage
    }
  }
];

